import React from "react";

import "./italy/italy";


const Card = () => {
  


  return (
    <div className="component">
      
      
      <div className="grid">
        {cardData.map((card, index) => (
          <div className="card" key={index}>
            <a href={card.link}>
              <img src={card.src} alt={card.alt} className="card-image" />
            </a>
            <p className="card-name">{card.name}</p>
          </div>
        ))}
      </div>
      
    </div>
  );
};

export default Card;
